Topics and services are defined by the interfaces: export interface RomiTopic<Message> { readonly validate: (msg: any) => Message; readonly type: string; readonly topic: string; readonly options?: Options;
} export interface RomiService<Request, Response> { readonly validateRequest: (msg: any) => Request; readonly validateResponse: (msg: any) => Response; readonly type: string; readonly service: string; readonly options?: Options;
} If you are familiar with ROS 2, the type field specifies the message type that the topic or service expects while topic/service are the topic and service names, respectively. Sometimes a topic or service is expected to use a different QoS option; for example a topic that does not publish when the state changes and expects late subscriptions to make use of transient local QoS to receive the latest state. The options specify the "default" QoS options that should be used. In this way, users do not have to refer to the usage instructions to correctly publish and subscribe to the topic. The validate* methods are used by the transport to convert an arbitrary object to the expected type of the topic or service. It should check if the object has the correct fields and that the fields are of the correct types. To ensure compatibility with different transports, these methods should be able to convert number arrays to typed arrays and vice versa. We can create custom topics or services by implementing these interfaces. They can then be passed to the transport's various methods. export const myTopic: RomiTopic<MyMessage> = { validate: validateMyMessage(msg), // some function that valides MyMessage type: 'my_messages/msg/MyMessage', topic: 'my_topic',
};

