A Transport in romi-js is a class with the interface: export interface Subscription { unsubscribe(): void;
} export interface Publisher<Message> { publish(msg: Message): void;
} export interface Service<Request, Response> { start(handler: (req: Request) => Promise<Response> | Response): void; stop(): void;
} export interface Transport extends TransportEvents { readonly name: string; createPublisher<Message extends unknown>( topic: RomiTopic<Message>, options?: Options, ): Publisher<Message>; subscribe<Message extends unknown>( topic: RomiTopic<Message>, cb: SubscriptionCb<Message>, options?: Options, ): Subscription; call<Request extends unknown, Response extends unknown>( service: RomiService<Request, Response>, req: Request, ): Promise<Response>; createService<Request extends unknown, Response extends unknown>( service: RomiService<Request, Response>, ): Service<Request, Response>; destroy(): void;
} There isn't a general guide on how the interface should be implemented since the details would be different for each transport. One thing to note is that it might be tempting to return a type derived from any (e.g. Publisher<any>) to pass the typescript checks but doing so is not recommended. You should call the validate* methods in the topic or service to convert something into a type of Message. To ensure compatibility with different topics and services, transports must de-serialize the data to a plain old data object. It can use either number arrays or typed arrays. The validate* methods should support converting them to the expected types. Found a bug? Edit this page on GitHub.

