Now that we know these programs work, we can dig into their code. Both programs start with the same preamble: #include "rclcpp/rclcpp.hpp"
#include "std_msgs/msg/string.hpp" We always need to include the rclcpp client library, which gives us much of what we need to write ROS applications in C++. But we also need to specifically import the ROS message type(s) that we will use. In this case we are using the simple std_msgs/String message, which contains a single field called data, of type string. If we wanted to use the sensor_msgs/Image message, which represents camera images, then we would #include "sensor_msgs/msg/image.hpp". After the imports, both programs perform common initialization: rclcpp::init(argc, argv); auto node = rclcpp::Node::make_shared("my_node_name"); We initialize the rclcpp library and then call into it to create a Node object, giving it a name. Subsequently we will operate on that Node object. In the talker, we use the Node object to create a Publisher object: auto pub = node->create_publisher<std_msgs::msg::String>("chatter", 10); We declare via template the type of data we will publish (std_msgs/String), the name of the topic on which we will publish (chatter), and the maximum number of outbound messages to locally queue up (10). That last argument comes into play when we are publishing faster than subscribers are consuming the data. The equivalent step in the listener is to create a Subscription object: auto sub = node->create_subscription<std_msgs::msg::String>("chatter", 10, cb); The type (String) and topic name (chatter) arguments have the same meaning as for the create_publisher() call, and the numerical argument (10) is setting an analogous maximum queue size for inbound messages. The key difference is the cb argument, which refers to this callback function that we also defined in the listener: void cb(const std_msgs::msg::String::SharedPtr msg)
{ std::cout << "I heard: " << msg->data << std::endl;
} That function will be called whenever the listener receives a message, and the received message will be passed in as an argument. In this case we simply print the content to console. With the callback defined and the Subscription created, the rest of the listener is one line: rclcpp::spin(node); This call hands control over to rclcpp to wait for new messages to arrive (and more generally for events to occur) and invoke our callback. Back in the talker, we create a simple loop to use our Publisher: std_msgs::msg::String message; auto i = 0; while (rclcpp::ok()) { message.data = "Hello world: " + std::to_string(i++); std::cout << "Publishing: " << message.data << std::endl; pub->publish(message); usleep(500000); } In these steps we create a message object, and then on each iteration of the loop we update the message content and publish it, sleeping briefly between iterations.

